const treeData = {
  name: "Kaguya",
  attributes: {
    Description: "Assembly",
  },
  children: [
    {
      name: "Hagoromo",
      attributes: {
        Description: "Sage of six paths",
      },
      children: [
        {
          name: "Indra",
          attributes: {
            Description: "Uchiha Clan",
          },
          children: [],
        },
        {
          name: "Ashura",
          attributes: {
            Description: "Senju and Uzumaki clan",
          },
          children: [],
        },
      ],
    },
    {
      name: "Hamura",
      attributes: {
        Description: "Otsutsuki on moon and hyuga on earth",
      },
      children: [
        {
          name: "Otsutsuki",
          attributes: {
            Description: "Otsutsuki on moon",
          },
          children: [
            {
              name: "Main",
              attributes: {
                Description: "Main branch of Otsutsuki of moon",
              },
              children: [],
            },
            {
              name: "Side",
              attributes: {
                Description: "Side branch of Otsutsuki of moon",
              },
              children: [],
            },
          ],
        },
        {
          name: "Hyuga",
          attributes: {
            Description: "Hyuga clan",
          },
          children: [
            {
              name: "Main",
              attributes: {
                Description: "Main branch of Hyuga clan",
              },
              children: [],
            },
            {
              name: "Side",
              attributes: {
                Description: "Side branch of Hyuga clan",
              },
              children: [],
            },
          ],
        },
      ],
    },
  ],
};

export default treeData;
